import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class SearchService {
  searchSubject = new Subject<string>();

  onSearch(value: string): void {
    if (value?.length >= 3) {
      this.searchSubject.next(value);
    }
  }
}
